import React from "react";
import { Bar } from "react-chartjs-2";

function BarChart(props) {
  return (
    <div>
      <Bar
        data={{
          labels: ["A", "B", "C", "D"],
          datasets: [
            {
              label: "test",
              data: [1, 2, 3, 4],
              backgroundColor: "blue",
            },
          ],
        }}
      ></Bar>
    </div>
  );
}

export default BarChart;
